    true,nt"url": null,nt"notes": "<p>The Centers for Medicare and Medicaid
    Services (CMS) has compiled a summary of overall Medicare Administrative Contractor
    (MAC) performance information as measured by the Quality Assurance Surveillance
    Plan (QASP) and Award Fee Plan (AF).  The QASP ensures that systematic quality assurance
    methods are used in administration of the contract and provides Government Surveillance
    oversight on the quality, quantity, and timeliness of contractor performance.  The
    Award Fee Plan is provided to motivate exceptional performance above what is outlined
    in the Statement of Work.</p>n",nt"license_title": "Other License Specified",nt"extras":
